# Approach:
# We can use a stack to keep track of the opening brackets.
# Whenever we encounter a closing bracket, we check if the top of the stack is an opening bracket of the same type.
# If it is, we pop the opening bracket from the stack and continue.
# If it isn't, we return 'No' as the string is not balanced.
# At the end, if the stack is empty, we return 'Yes' as the string is balanced.

def match_parens(lst):
    stack = []
    for s in lst:
        for c in s:
            if c == '(':
                stack.append(c)
            else:
                if not stack or stack[-1] != '(':
                    return 'No'
                stack.pop()
    if not stack:
        return 'Yes'
    else:
        return 'No'

